import { prisma } from '../components/db'

/*********************************************
 * SEEDING THE DATABASE WITH DEFAULT CONTENT *
 *********************************************/

const DEFAULT_CONTENT = [{
    label: "SITE_INTRO",
    value: "Welcome to the NFT Mailing List!"
}, {
    label: "SITE_HOOK",
    value: "By joining the mailing list you can receive updates from your favourite NFT minters via email."
}, {
    label: "SITE_BANNER",
    value: "data:image/png;base64,"
}];

const seed = async () => {
    try {

        await prisma.content.createMany({
            data: DEFAULT_CONTENT
        });

    } catch (e) {
        console.log(`Assuming the database has already been seeded, skipping`)
        process.exit(1)
    } finally {
        await prisma.$disconnect()
    }

    console.log(`Database Seeded!`);
}

seed();